import React from 'react';
import { Container, Typography } from '@mui/material';

const DofAc = () => {
    return (
        <Container>
            <Typography variant="h4" gutterBottom>
                Dof Aç
            </Typography>
            <Typography>Bu bölümde yeni bir dof açabilirsiniz.</Typography>
        </Container>
    );
};

export default DofAc;
